import React from "react";
import Vector from "../../svgs/Vector.png";
import VectorOutline from "../../svgs/VectorOutline.png";
import Student from "../../svgs/student.png";
import  "./TPayment.css";
const TPayment = () => {
return (
<div className="main">
<div className="imgContainer">
            <div className="overlapWrapper">
              <img className="img2" alt="Vector" src={Vector} />
              <img className="img2" alt="Mask group" src={VectorOutline} />
              <img className="maskGroup" alt="Mask group" src={Student} />
            </div>
          </div>
          <div>Track your school fees <br/>payments quickly and <br/>accurately</div>
          <div>Track your fees using your reference number. You can find this reference number in the email that was sent to you.</div>
          <div>Get started here</div>
          <div style={{width: '100%', height: '100%', padding: 20, background: 'white', borderRadius: 28, overflow: 'hidden', border: '1px #D3E8FE solid', justifyContent: 'flex-start', alignItems: 'center', gap: 10, display: 'inline-flex'}}>
    <div style={{color: '#858585', fontSize: 14, fontFamily: 'Oldschool Grotesk Trial', fontWeight: '350', lineHeight: 19.14, wordWrap: 'break-word'}}>Enter your reference number</div>
    <div style={{width: '100%', height: '100%', paddingLeft: 33, paddingRight: 33, paddingTop: 14, paddingBottom: 14, background: '#218BFC', borderRadius: 34.21, overflow: 'hidden', justifyContent: 'center', alignItems: 'center', gap: 10, display: 'inline-flex'}}>
    <div style={{color: 'white', fontSize: 14, fontFamily: 'Oldschool Grotesk Trial', fontWeight: '500', wordWrap: 'break-word'}}>Track payment</div>
</div>
<div><span style="color: 'white', fontSize: 14, fontFamily: 'Oldschool Grotesk Trial', fontWeight: '350', lineHeight: 19.14, wordWrap: 'break-word'">Lost your reference number? </span><span style="color: '#218BFC', fontSize: 14, fontFamily: 'Oldschool Grotesk Trial', fontWeight: '350', textDecoration: 'underline', lineHeight: 19.14, wordWrap: 'break-word'">Chat with us</span></div>
</div>
    <h1>ok</h1>
</div>
  );
};
export default TPayment;
